import React from 'react';
import {useState,useEffect} from 'react';
import './App.css';

export default function Posts() {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/posts")
        .then(res => res.json())
        .then(data => setPosts(data))
    }, []);

  return (
    <table>
        <thead>
            <tr>
                <td>Title</td>
                <td>Description</td>
                <td>Actions</td>
            </tr>
        </thead>
        <tbody>
            {posts.map(post => (
                <tr>
                    <td>{post.title}</td>
                    <td>{post.body}</td>
                    <td></td>
                </tr>
            ))}
            <tr>

            </tr>
        </tbody>
    </table>
  );
}
